t_020_ecs.llm_output:
use spacetimedb::{ReducerContext, Table};

#[spacetimedb::table(name = entities)]
pub struct Entity {
    #[primary_key]
    id: i32,
}

#[spacetimedb::table(name = positions)]
pub struct Position {
    #[primary_key]
    entity_id: i32,
    x: i32,
    y: i32,
}

#[spacetimedb::table(name = velocities)]
pub struct Velocity {
    #[primary_key]
    entity_id: i32,
    vx: i32,
    vy: i32,
}

#[spacetimedb::table(name = next_positions)]
pub struct NextPosition {
    #[primary_key]
    entity_id: i32,
    x: i32,
    y: i32,
}

#[spacetimedb::reducer]
pub fn seed(ctx: &ReducerContext) {
    let _ = ctx.db.entities().try_insert(Entity { id: 1 });
    let _ = ctx.db.positions().try_insert(Position { entity_id: 1, x: 0, y: 0 });
    let _ = ctx.db.velocities().try_insert(Velocity { entity_id: 1, vx: 1, vy: 0 });

    let _ = ctx.db.entities().try_insert(Entity { id: 2 });
    let _ = ctx.db.positions().try_insert(Position { entity_id: 2, x: 10, y: 0 });
    let _ = ctx.db.velocities().try_insert(Velocity { entity_id: 2, vx: -2, vy: 3 });
}

#[spacetimedb::reducer]
pub fn step(ctx: &ReducerContext) {
    for pos in ctx.db.positions().iter() {
        let vel_opt = ctx.db.velocities().entity_id().find(pos.entity_id);
        let (vx, vy) = match vel_opt {
            Some(v) => (v.vx, v.vy),
            None => (0, 0),
        };
        let next = NextPosition {
            entity_id: pos.entity_id,
            x: pos.x + vx,
            y: pos.y + vy,
        };
        match ctx.db.next_positions().entity_id().find(pos.entity_id) {
            Some(_) => {
                ctx.db.next_positions().entity_id().update(next);
            }
            None => {
                ctx.db.next_positions().insert(next);
            }
        }
    }
}

