using SpacetimeDB;

public static partial class Module
{
    [SpacetimeDB.Table(Name = "Entity", Public = true)]
    public partial struct Entity
    {
        [SpacetimeDB.PrimaryKey]
        public int Id;
    }

    [SpacetimeDB.Table(Name = "Position", Public = true)]
    public partial struct Position
    {
        [SpacetimeDB.PrimaryKey]
        public int EntityId;
        public int X;
        public int Y;
    }

    [SpacetimeDB.Table(Name = "Velocity", Public = true)]
    public partial struct Velocity
    {
        [SpacetimeDB.PrimaryKey]
        public int EntityId;
        public int VX;
        public int VY;
    }

    [SpacetimeDB.Table(Name = "NextPosition", Public = true)]
    public partial struct NextPosition
    {
        [SpacetimeDB.PrimaryKey]
        public int EntityId;
        public int X;
        public int Y;
    }

    [SpacetimeDB.Reducer]
    public static void Seed(ReducerContext ctx)
    {
        InsertEntityWithComponents(ctx, 1, 0, 0, 1, 0);
        InsertEntityWithComponents(ctx, 2, 10, 0, -2, 3);
    }

    private static void InsertEntityWithComponents(ReducerContext ctx, int id, int x, int y, int vx, int vy)
    {
        if (ctx.Db.Entity.Id.Find(id) is not Entity)
        {
            ctx.Db.Entity.Insert(new Entity { Id = id });
        }

        if (ctx.Db.Position.EntityId.Find(id) is Position existingPos)
        {
            existingPos.X = x;
            existingPos.Y = y;
            ctx.Db.Position.EntityId.Update(existingPos);
        }
        else
        {
            ctx.Db.Position.Insert(new Position { EntityId = id, X = x, Y = y });
        }

        if (ctx.Db.Velocity.EntityId.Find(id) is Velocity existingVel)
        {
            existingVel.VX = vx;
            existingVel.VY = vy;
            ctx.Db.Velocity.EntityId.Update(existingVel);
        }
        else
        {
            ctx.Db.Velocity.Insert(new Velocity { EntityId = id, VX = vx, VY = vy });
        }
    }

    [SpacetimeDB.Reducer]
    public static void Step(ReducerContext ctx)
    {
        foreach (var pos in ctx.Db.Position.Iter())
        {
            if (ctx.Db.Velocity.EntityId.Find(pos.EntityId) is not Velocity vel)
            {
                continue;
            }

            var nx = pos.X + vel.VX;
            var ny = pos.Y + vel.VY;

            if (ctx.Db.NextPosition.EntityId.Find(pos.EntityId) is NextPosition next)
            {
                next.X = nx;
                next.Y = ny;
                ctx.Db.NextPosition.EntityId.Update(next);
            }
            else
            {
                ctx.Db.NextPosition.Insert(new NextPosition
                {
                    EntityId = pos.EntityId,
                    X = nx,
                    Y = ny
                });
            }
        }
    }
}

